/* eslint-disable no-param-reassign */
import { createSlice } from '@reduxjs/toolkit';
import faker from 'faker';

export const applicantsSlice = createSlice({
  name: 'applicants',
  initialState: {
    applicants: [...Array(10).keys()].map(() => ({
      userId: faker.datatype.number(),
      name: faker.name.findName(),
      handle: faker.name.findName(),
      priorityQueue: faker.datatype.number(),
      score: faker.datatype.number(),
      applicationDate: faker.date.past().toDateString(),
    })),
  },
  reducers: {
    updateApplicants(state, action) {
      state.applicants = [
        ...action.payload,
      ];
    },
  },
});

// Action creators are generated for each case reducer function
export const { updateApplicants } = applicantsSlice.actions;

export default applicantsSlice.reducer;
